import React, {Component} from 'react';
import './Welcome.css';
import Dropdown from 'react-bootstrap/Dropdown';

class Welcome extends Component{

    render(){
        return(
            <div id="main">
            <h2 id="welcomeText">Welcome to KostumeArt Platform</h2>
            <Dropdown>
                <Dropdown.Toggle variant="success" id="dropdown-basic">
                    Insert
                </Dropdown.Toggle>

                <Dropdown.Menu>
                    <Dropdown.Item href='/insertCostume'>Costume</Dropdown.Item>
                    <Dropdown.Item href="#/action-2">Accessorie</Dropdown.Item>
                    <Dropdown.Item href="#/action-3">Costume Use</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>

            <a href='/displayCostumes' className="button">Costumes Archive</a>
            <a href='/' className="button warning">Delete data</a>
            </div>
        );
    }
}

export default Welcome;
